import React from 'react';
import NVD3Chart from 'react-nvd3';

const datum = [
    {
        key: 'Cumulative Return',
        values: [
            {
                label: '0-50',
                value: 32,
                color: '#263238'
            },
            {
                label: '50-100',
                value: 256,
                color: '#263238'
            },
            {
                label: '100-150',
                value: 144,
                color: '#263238'
            },
            {
                label: '150-200',
                value: 168,
                color: '#263238'
            },
            {
                label: '200-250',
                value: 248,
                color: '#263238'
            },
            {
                label: '250-300',
                value: 96,
                color: '#263238'
            },
            {
                label: '300-350',
                value: 144,
                color: '#263238'
            },
            {
                label: '350-400',
                value: 168,
                color: '#263238'
            },
            {
                label: '400+',
                value: 40,
                color: '#0074B7'
            }
        ]
    }
];

const BarDiscreteChart = () => {
    return <NVD3Chart tooltip={{ enabled: true }} type="discreteBarChart" datum={datum} x="label" y="value" height={300} showValues />;
};

export default BarDiscreteChart;
